import React from "react";
import { useState, useEffect } from "react";
export default function Refecto({ data }) {
  const recur = (data) => {
    for (var key in data) {
      if (typeof data[key] === "object" && data[key] !== null) {
        recur(data[key]);
      } else {
        console.log(key, data[key]);
        //return { key: data[key] };
      }
    }
  };

  return (
    <div className="code-block">
      <pre>{recur(data)}</pre>
    </div>
  );
}
